bool_t
xdr_guestfs_tune2fs_args (XDR *xdrs, guestfs_tune2fs_args *objp)
{
	register int32_t *buf;


	if (xdrs->x_op == XDR_ENCODE) {
		 if (!xdr_string (xdrs, &objp->device, ~0))
			 return FALSE;
		buf = XDR_INLINE (xdrs, 3 * BYTES_PER_XDR_UNIT);
		if (buf == NULL) {
			 if (!xdr_bool (xdrs, &objp->force))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->maxmountcount))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->mountcount))
				 return FALSE;

		} else {
		IXDR_PUT_BOOL(buf, objp->force);
		IXDR_PUT_LONG(buf, objp->maxmountcount);
		IXDR_PUT_LONG(buf, objp->mountcount);
		}
		 if (!xdr_string (xdrs, &objp->errorbehavior, ~0))
			 return FALSE;
		 if (!xdr_int64_t (xdrs, &objp->group))
			 return FALSE;
		 if (!xdr_int (xdrs, &objp->intervalbetweenchecks))
			 return FALSE;
		 if (!xdr_int (xdrs, &objp->reservedblockspercentage))
			 return FALSE;
		 if (!xdr_string (xdrs, &objp->lastmounteddirectory, ~0))
			 return FALSE;
		 if (!xdr_int64_t (xdrs, &objp->reservedblockscount))
			 return FALSE;
		 if (!xdr_int64_t (xdrs, &objp->user))
			 return FALSE;
		return TRUE;
	} else if (xdrs->x_op == XDR_DECODE) {
		 if (!xdr_string (xdrs, &objp->device, ~0))
			 return FALSE;
		buf = XDR_INLINE (xdrs, 3 * BYTES_PER_XDR_UNIT);
		if (buf == NULL) {
			 if (!xdr_bool (xdrs, &objp->force))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->maxmountcount))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->mountcount))
				 return FALSE;

		} else {
		objp->force = IXDR_GET_BOOL(buf);
		objp->maxmountcount = IXDR_GET_LONG(buf);
		objp->mountcount = IXDR_GET_LONG(buf);
		}
		 if (!xdr_string (xdrs, &objp->errorbehavior, ~0))
			 return FALSE;
		 if (!xdr_int64_t (xdrs, &objp->group))
			 return FALSE;
		 if (!xdr_int (xdrs, &objp->intervalbetweenchecks))
			 return FALSE;
		 if (!xdr_int (xdrs, &objp->reservedblockspercentage))
			 return FALSE;
		 if (!xdr_string (xdrs, &objp->lastmounteddirectory, ~0))
			 return FALSE;
		 if (!xdr_int64_t (xdrs, &objp->reservedblockscount))
			 return FALSE;
		 if (!xdr_int64_t (xdrs, &objp->user))
			 return FALSE;
	 return TRUE;
	}

	 if (!xdr_string (xdrs, &objp->device, ~0))
		 return FALSE;
	 if (!xdr_bool (xdrs, &objp->force))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->maxmountcount))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->mountcount))
		 return FALSE;
	 if (!xdr_string (xdrs, &objp->errorbehavior, ~0))
		 return FALSE;
	 if (!xdr_int64_t (xdrs, &objp->group))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->intervalbetweenchecks))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->reservedblockspercentage))
		 return FALSE;
	 if (!xdr_string (xdrs, &objp->lastmounteddirectory, ~0))
		 return FALSE;
	 if (!xdr_int64_t (xdrs, &objp->reservedblockscount))
		 return FALSE;
	 if (!xdr_int64_t (xdrs, &objp->user))
		 return FALSE;
	return TRUE;
}

