			 return FALSE;
		 if (!xdr_int64_t (xdrs, &objp->agstride))
			 return FALSE;
		 if (!xdr_string (xdrs, &objp->logdev, ~0))
			 return FALSE;
		 if (!xdr_string (xdrs, &objp->rtdev, ~0))
			 return FALSE;
		return TRUE;
